const TimerComtent = styled.div`
  display: flex;
  justify-content: center;
  align-items: center; 
  height: 38px;
  width: 413px;
  border-radius: nullpx;
  font-weight: 700;
  letter-spacing: 0.12em;
  font-family: 'Verdana';
  color: #EA5D5D;
`;

export default TimerComtent;
